import { getAllPosts } from "../lib/api";

const HomePage = ({ posts }) => {
    console.log(posts);
    return (
        <div>
            Coucou la famille!
        </div>
    );
};

export function getStaticProps() {
    const posts = getAllPosts();
    return {
        posts,
    };
}

export default HomePage;
